from typing import List
from collections import defaultdict

class Solution:
    def findHighAccessEmployees(self, access_times: List[List[str]]) -> List[str]:
        def time_diff(t1: str, t2: str) -> int:
            h1, m1 = int(t1[:2]), int(t1[2:])
            h2, m2 = int(t2[:2]), int(t2[2:])
            return (h2 - h1) * 60 + (m2 - m1)

        employee_access = defaultdict(list)
        for name, time in access_times:
            employee_access[name].append(time)

        for times in employee_access.values():
            times.sort()

        high_access_employees = set()
        for name, times in employee_access.items():
            for i in range(len(times)):
                for j in range(i+2, len(times)):
                    if time_diff(times[i], times[j]) < 60:
                        high_access_employees.add(name)
                        break

        return list(high_access_employees)
